import React, { useState } from 'react';

const MovieList = () => {
    [movies, setMovie] = useState(
        [
            {
                name: 'Game of thorones',
                price: '10$',
                id: '1'
            },
            {
                name: 'Harry Poter',
                price: '10$',
                id: '2'
            },
            {
                name: 'Hixa hi hi hiiiii',
                price: '10$',
                id: '3'
            }
        ]
    );


}


export default MovieList;
